import { FaTimes } from 'react-icons/fa'
import { IconContext } from 'react-icons'

const Experience = ({ exp, onDelete }) => {
    return (
        <div>
            <h3>{exp.company} <FaTimes style={color='red',cursor='pointer'} onClick={onDelete} /></h3>
            <h3>{exp.role}</h3>
            <h4>{exp.date}</h4>
            <p>{exp.description}</p>
        </div>
    )
}

export default Experience
